rinol 300 mg tablet</td>\r\n        <td>Active</td>\r\n        <td>2023-02-21</td>\r\n        <td>Take ONE tablet daily, after meals</td>\r\n      </tr>\r\n    </tbody>\r\n  </table>\r\n</div>"
